var title_f23_34_24098="Jejunoileal bypass";
var content_f23_34_24098=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F53171&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F53171&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Jejunoileal bypass",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 339px; height: 526px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The jejunoileal bypass (also called the intestinal bypass) is performed by dividing the jejunum close to the ligament of Treitz and connecting it a short distance proximal to the ileocecal valve, thereby diverting a long segment of small bowel, resulting in malabsorption. This procedure is no longer performed due to the high complication rate and frequent need for revisional surgery.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Jones DB, Schneider BE, Olbers T. Atlas of Metabolic and Weight Loss Surgery. Cine-Med, North Woodbury, Connecticut 2010. Copyright &copy; 2010 Cine-Med.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
