"     <li>",
"      Cyclogyl (AE, AU, BE, BF, BG, BH, BJ, CH, CI, CL, CO, CY, DK, EG, ET, GH, GM, GN, GR, IL, IN, IQ, IR, JO, KE, KP, KW, LB, LR, LY, MA, ML, MR, MU, MW, NE, NG, NL, NZ, OM, PK, QA, SA, SC, SD, SE, SG, SL, SN, SY, TH, TN, TW, TZ, UG, UY, VE, YE, ZA, ZM, ZW);",
