"      Minims-Cyclopentolate (IE);",
"     </li>",
"     <li>",
"      Mydrilate (GB, IE);",
"     </li>",
"     <li>",
"      Oftan-Syklo (FI, PL);",
"     </li>",
"     <li>",
"      Refractyl Ofteno (CR, DO, GT, HN, PA, PE, SV);",
"     </li>",
"     <li>",
"      Skiacol (FR);",
"     </li>",
"     <li>",
"      Zyklolat EDO (LU);",
"     </li>",
"     <li>",
"      Zyklolat-Edo (DE)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F155315\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Prevents the muscle of the ciliary body and the sphincter muscle of the iris from responding to cholinergic stimulation, causing mydriasis and cycloplegia",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F155331\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action: Peak effect: Cycloplegia: 25-75 minutes; Mydriasis: 30-60 minutes",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Duration: &le;24 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Systemic absorption poor (Haaga, 1998)",
"    </p>",
"   </div>",
"  </div>",
