" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 541px\">",
"   <div class=\"ttl\">",
"    25-year-old woman with presumed moyamoya disease",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 521px; height: 558px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A) MRA shows almost no flow related enhancement in the distal supraclinoid internal carotid arteries or the proximal anterior and middle cerebral arteries. B) Source image from the MRA shows multiple collateral arterial vessels in the basal ganglia (white arrow). C) Right internal carotid artery injection from a conventional angiogram, lateral projection, shows multiple collateral vessels arising around the occluded proximal anterior and cerebral arteries (black arrow). D) Right external carotid artery injection from a conventional angiogram, lateral projection, shows collaterals to the middle cerebral artery distribution (black arrow).",
"    <div class=\"footnotes\">",
"    </div>",
