var title_f23_34_24106="Pathophysiology of acute malignant hyperthermia";
var content_f23_34_24106=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F58185&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F58185&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 503px\">",
"   <div class=\"ttl\">",
"    Pathophysiology of acute malignant hyperthermia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 483px; height: 742px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Exposure of an individual who has a genetic susceptibility (ryanodine receptor [",
"    <em>",
"     RYR1",
"    </em>",
"    ] or dihydropyridine receptor [",
"    <em>",
"     DHP",
"    </em>",
"    ] mutation) to an anesthetic triggering agent (ie, volatile inhalational anesthetic agent, succinylcholine, or both) may result in malignant hyperthermia. This reaction is caused by an altered calcium balance between the lumen of the sarcoplasmic reticulum (SR) and the sarcoplasm. Normally, muscle cell depolarization is sensed by the DHP receptor, which is thought to signal RYR1 opening by a direct physical connection. In malignant hyperthermia, accumulation of abnormally high levels of calcium in the sarcoplasm causes uncontrolled anaerobic and aerobic metabolism and sustained muscle cell contraction. This results in the clinical manifestations of respiratory acidosis, metabolic acidosis, muscle rigidity, and hyperthermia. If the process continues unabated, adenosine triphosphate (ATP) depletion eventually causes widespread muscle fiber hypoxia (cell death, rhabdomyolysis), which manifests clinically as hyperkalemia and myoglobinuria and an increase in creatine kinase. Dantrolene sodium binds to RYR1, causing it to favor the closed state, thereby reversing the uninhibited flow of calcium into the sarcoplasm.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Litman RS, Rosenberg H. Malignancy Hyperthermia: Update on Susceptibility Testing. JAMA 2005; 293:2918. Copyright &copy; 2005 American Medical Association. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
