var title_f23_34_24111="de Quervains injection";
var content_f23_34_24111=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F65518&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F65518&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Injection for de Quervain's tenosynovitis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 382px; height: 268px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The hand is placed in a neutral position and turned on the side with the radial side up. The radial styloid is identified and marked. The point of entry is halfway between the abductor pollicis longus and the extensor pollicis longus tendons at the radial styloid (about 3/8 inch proximal to the tip of the radial styloid). Ethyl chloride is applied to the skin for anesthesia. A 5/8 inch, 25 gauge needle is inserted at a 45&ordm; angle to a depth of 3/8 to 1/2 inch, flush against the periosteum of the radial styloid. If bone is not encountered at this depth the point of entry may have been too distal. Two to 3 mL lidocaine is injected to perform local anesthetic block; a bubble should appear. Moderate pressure to injection, a poorly distensible sac, or both may indicate chronic stenosis of the tendons. For therapeutic injection, the needle is left in place, the syringe containing the anesthetic is removed and replaced with a syringe containing 1/2 mL methylprednisolone (80 mg/mL) that is then injected.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Bruce C Anderson, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
